const InfoText = ({ clientName }) => {
  switch (clientName) {
    case "Oak":
      <>
        From conception, I was responsible for the UX design, UI design & Frond
        End development of the education platform Oak which grew to millions of
        daily users during the last year of COVID-19.
        <br />
        This involved designing 3 apps, over months of non-stop designing,
        testing and coding.
      </>;
      break;
    case "Mangoes":
    case "Papayas":
      console.log("Mangoes and papayas are $2.79 a pound.");
      // expected output: "Mangoes and papayas are $2.79 a pound."
      break;
    default:
      <p>no desc</p>;
  }
};

export default InfoText;
